function progress(n,t){var i=n*t.width()/100;t.find(".progressbar-value").animate({width:i},1200)}$(document).on("ready",function(){$(".progressbar").each(function(){var n=$(this),t=$(this).attr("data-value");progress(t,n)})});$(function(){$("#header-right, .updateEasyPieChart, .complete-user-profile, #progress-dropdown, .progress-box").hover(function(){$(".progressbar").each(function(){var n=$(this),t=$(this).attr("data-value");progress(t,n)})})});